  }
}

function () {
    cy.step('Import snapshot');

    _cypressAppControls.api.restoreSnapshotViaAPI(_cypressAppControls.snapshots.userSystems).then(function (siteSlug) {
      cy.step('Enable user systems beta');

      _cypressAppControls.api.addSiteToBeta(siteSlug, 'userSystems');

      cy.step('Visit designer');
      cy.visit("".concat(Cypress.env('baseUrl'), "/design/").concat(siteSlug));
      workspace = _cypressAppControls.api.waitForDesigner();
      cy.step('Get canvas');
      canvas = workspace.getCanvas();
      cy.step('Get Finder');
      finder = workspace.getFinder();
      cy.step('Get left sidebar');
      leftSidebar = workspace.getLeftSidebar();
      cy.step('Get right panel');
      rightPanel = workspace.getRightPanel();
    });
  }

